/* eslint-disable */

import "./App.css";
import Title from "./component/Title";
import Body from "./component/Body";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Title />
        <Routes>
          <Route path="*" element={<Body />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
